import { Component, OnInit } from '@angular/core';
import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';

@Injectable({
  providedIn: 'root'
})
@Component({
  selector: 'app-qlphantrang',
  templateUrl: './qlphantrang.component.html',
  styleUrls: ['./qlphantrang.component.css']
})
export class QlphantrangComponent {
  constructor(private http: HttpClient) { }

  getWatches() {
    return this.http.get('url-to-get-watches');
  }
}
